import React from "react";

import '../Css/PiedraPapelTijera.css';

function PiedraPapelTijera() {
  return(
    <div>
      <div className="piedra">
        piedra
      </div>
      <div className="papel">
        papel
      </div>
      <div className="tijera">
        tijera
      </div>
    </div>
  )
}

export default PiedraPapelTijera;
